import React from "react";
import DeleteIcon from "@mui/icons-material/Delete";
import Button from "@mui/material/Button";

const Notee = () => {
  return (
    <>
      <div className="note">
        <h1>Title</h1>
        <br />
        <p>This is content</p>
        <button>
          <DeleteIcon className="deleteIcon " />
        </button>
      </div>
    </>
  );
};

export default Notee;
